import logo from './logo.svg';
import React, { Component } from 'react'
import Headers from './Headers'
import Body from './Body'
import './App.css';
const project = [
  { title: 'Mountain View', person: 'Check out all of these gorgeous mountain trips with beautiful views of, you guessed it, the mountains', id: 'View Trips' }, 
  { title: 'To The Beach', person: 'Plan your next beach trip with these fabulous destinations', id: 'View Trips' }, 
  { title: 'Desert Destinations', person: 'It\'s the desert you\'ve always dreamed of', id: 'Book Now' }, 
  { title: 'Explore The Galaxy', person: 'Seriously, straight up, just blast off into outer space today', id: 'Book Now' }
]
class App extends Component {

    state = {
      profil: "visiteur",
    }
    render() {
      const {profil} = this.state
      return (
        <div className="App">
          <Headers profil={profil}/>
          <Body profil={profil, project}/>
        </div>
      )
    }
  }

export default App;
